import React from "react";
import Fade from 'react-reveal/Fade';
import "./Contact.css";
const Contact = () => {
    return(
    <Fade top>
    <h1 id='contact' className="white tc" > Contact Me</h1>
    <div className="tc">
    <form>
    <input type="text" id="fname" name="fname" placeholder='Your Name' required='true' className="white tc" />
    <br />
    <input type="text" id="email" name="lname" placeholder='Your Email' required='true' className="white tc"/>
    </form>
    </div>
    </Fade>
    )
}

export default Contact;
